from utils import DirInfofrom dbmaster import MasterPathsdef test_paths():    mpaths = MasterPaths()        rawPath = mpaths.getRawPath()    assert isinstance(rawPath, DirInfo), f"rawPath [{rawPath}] is not a DirInfo"    assert rawPath.exists(), f"Error setting RawPath [{rawPath}]"        modValPath = mpaths.getModValPath()    assert isinstance(modValPath, DirInfo), f"modValPath [{modValPath}] is not a DirInfo"    assert modValPath.exists(), f"Error setting ModValPath [{modValPath}]"        summaryPath = mpaths.getSummaryPath()    assert isinstance(summaryPath, DirInfo), f"summaryPath [{summaryPath}] is not a DirInfo"    assert summaryPath.exists(), f"Error setting SummaryPath [{summaryPath}]"        matchPath = mpaths.getMatchPath()    assert isinstance(matchPath, DirInfo), f"matchPath [{matchPath}] is not a DirInfo"    assert matchPath.exists(), f"Error setting MatchPath [{matchPath}]"